import { useState } from "react";
import fetch from "isomorphic-unfetch";

const BASE_PATH =
  "http://virtserver.swaggerhub.com/ziroppe/WeWantToEatJiro/1.0.0";

const App = () => {
  return <h1>ちんこ</h1>;
};

App.getInitialProps = async ({ req }) => {
  // ルームの全てのカテゴリを取得
  const res = await fetch(BASE_PATH + "/categories");
  const data = await res.json();
  console.log(data);
  return { data };
};
export default App;
